import React from "react";
import "../Main/main.css";
import mainImag from "../Assests/Virat_kohli_wallpaper_Virat_kohli_4k_wallpapers_-removebg-preview.png";
function Main() {
  return (
    <>
      <div className="main">
        <div className="child">
          <h3>hello i'm</h3>
          <h1>prajapati shailesh</h1>
          <h2>frontend frontendDevloper</h2>
        </div>
        <div className="child">
          <img src={mainImag} alt="mainimg" />
        </div>
      </div>
    </>
  );
}

export default Main;
